import React, { FC } from 'react';

import Link from 'next/link';
import PostLink from 'next/link';
import { ItemWrapper, Item, Title } from "./CardStyles";

interface Props {
  title?: string;
  children?: any;
  id?: any;
}

export const Card: FC<Props> = ({ title, id, children }) => (
  <Item>
    <ItemWrapper>
      <Title>
        <Link href="/post/[id]" as={`/post/${id}`}>
          <a>{`${title}`}</a>
        </Link>
      </Title>
      { children }
    </ItemWrapper>
  </Item>
);
